With(
    {
        primaryIsValid: !IsEmpty(comPrimaryHiringManager_JobForm.SelectedItems),
        otherIsValid: true
    },
    {
        Value: Filter(
            Ungroup(
                [
                    ForAll(
                        comPrimaryHiringManager_JobForm.SelectedItems,
                        {
                            id: id,
                            name: name,
                            role: role,
                            email: email,
                            idSystemUser: idSystemUser,
                            primary: true
                        }
                    ),
                    ForAll(
                        comOtherHiringManagers_JobForm.SelectedItems,
                        {
                            id: id,
                            name: name,
                            role: role,
                            email: email,
                            idSystemUser: idSystemUser,
                            primary: false
                        }
                    )
                ],
                "Value"
            ),
            !IsBlank(id)
        ),
        PrimaryIsValid: primaryIsValid,
        OtherIsValid: otherIsValid,
        IsValid: primaryIsValid && otherIsValid
    }
)

